import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';

// Импорт компонентов страниц
import Layout from './components/Layout';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import RoomsPage from './pages/RoomsPage';
import RoomDetailPage from './pages/RoomDetailPage';
import ProfilePage from './pages/ProfilePage';
import BookingsPage from './pages/BookingsPage';
import BookingDetailPage from './pages/BookingDetailPage';
import AdminDashboardPage from './pages/admin/DashboardPage';
import AdminRoomsPage from './pages/admin/RoomsPage';
import AdminBookingsPage from './pages/admin/BookingsPage';
import AdminCustomersPage from './pages/admin/CustomersPage';
import AdminCustomerDetailPage from './pages/admin/CustomerDetailPage';
import AdminAnalyticsPage from './pages/admin/AnalyticsPage';
import NotFoundPage from './pages/NotFoundPage';

// Защищенный маршрут для аутентифицированных пользователей
const PrivateRoute = ({ children, roles = [] }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return <div>Загрузка...</div>;
  }

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  if (roles.length > 0 && !roles.includes(user.role)) {
    return <Navigate to="/" replace />;
  }

  return children;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<Layout />}>
            {/* Публичные страницы */}
            <Route index element={<HomePage />} />
            <Route path="rooms" element={<RoomsPage />} />
            <Route path="rooms/:id" element={<RoomDetailPage />} />
            <Route path="login" element={<LoginPage />} />
            <Route path="register" element={<RegisterPage />} />

            {/* Защищенные страницы для аутентифицированных пользователей */}
            <Route path="profile" element={
              <PrivateRoute>
                <ProfilePage />
              </PrivateRoute>
            } />
            <Route path="bookings" element={
              <PrivateRoute>
                <BookingsPage />
              </PrivateRoute>
            } />
            <Route path="bookings/:id" element={
              <PrivateRoute>
                <BookingDetailPage />
              </PrivateRoute>
            } />

            {/* Административные страницы */}
            <Route path="admin/dashboard" element={
              <PrivateRoute roles={['admin', 'manager']}>
                <AdminDashboardPage />
              </PrivateRoute>
            } />
            <Route path="admin/rooms" element={
              <PrivateRoute roles={['admin', 'manager']}>
                <AdminRoomsPage />
              </PrivateRoute>
            } />
            <Route path="admin/bookings" element={
              <PrivateRoute roles={['admin', 'manager']}>
                <AdminBookingsPage />
              </PrivateRoute>
            } />
            <Route path="admin/customers" element={
              <PrivateRoute roles={['admin', 'manager']}>
                <AdminCustomersPage />
              </PrivateRoute>
            } />
            <Route path="admin/customers/:id" element={
              <PrivateRoute roles={['admin', 'manager']}>
                <AdminCustomerDetailPage />
              </PrivateRoute>
            } />
            <Route path="admin/analytics" element={
              <PrivateRoute roles={['admin', 'manager']}>
                <AdminAnalyticsPage />
              </PrivateRoute>
            } />

            {/* Страница 404 */}
            <Route path="*" element={<NotFoundPage />} />
          </Route>
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
